@pytest.mark.otherv
def test_otherV_success(counter, tdate, expected):
    result = scanSignals("", 0, counter, loadjson(counter, tdate), 0)
    result, expected = matchpartial(result, expected, 2)
    assert result == expected, "*** Input = " + counter + "," + tdate


def matchpartial(res, exp, partialmatch=2):
    newexp = []
    newres = res.replace('\t', '')
    # endpos = partialmatch + 1
    if partialmatch:
        tmpres = newres.split(",")
        tmpexp = exp.split(",")
        newres = []
        val1 = tmpres[2].split(".")
        val2 = tmpexp[2].split(".")
        for i in range(len(val1)):
            if int(val1[i]) > 0:
                newres.append(1)
            elif int(val1[i]) < 0:
                newres.append(-1)
            else:
                newres.append(0)
            if int(val2[i]) > 0:
                newexp.append(1)
            elif int(val2[i]) < 0:
                newexp.append(-1)
            else:
                newexp.append(0)
        # newres = ",".join(tmpres[:endpos])
        # newexp = ",".join(tmpexp[:endpos])
    else:
        newexp = exp
    return newres, newexp
